import './App.css';
import Navbar from "./components/Navbar/Navbar";
import Home from "./pages/Home/Home";
import NotHome from "./pages/NotHome/NotHome";
import { Routes, Route, uselo } from "react-router-dom";

function App() {
  const location = useLocation(); // Get current route path

  return (
    <div className="App">
      <Navbar />
      {/* <header className="main-page">
        <p> My Website Yay!</p>
      </header> */}

      {location.pathname !== "/" && (
        <header className="main-page">
          <p> My Website Yay!</p>
        </header>
      )}
      <Routes>
        <Route path="/pages/Home/Home.js" element={<Home />} />
        <Route path="/pages/NotHome/NotHome.js" element={<NotHome />} />
      </Routes>
    </div>
  );
}

export default App;
